import React from "react";

const TodoList = ({ todos,handleDelete,handleEdit }) => {
    
  return (
    <div>
      {todos.map((item, id) => (
        <div key={id}>
          <p key={id}>{item}</p>
          <button>Edit</button>
          <button onClick={()=>handleDelete(id)} >Delete</button>
        </div>
      ))}
    </div>
  );
};

export default TodoList;
